import * as React from 'react'

export default function PokemonDetails(props) {

  if (!props.selected) return "Loading..."

  return (
    <div>
      <h1>Selected Pokemon</h1>
      <div>
        {props.selected.name}
      </div>
      <div>
        <img src={props.selected.image} alt={props.selected.image} />
      </div >
      <div>
        {props.selected.weight}
      </div >
      <div>
        {props.selected.height}
      </div>
      <select id="favorite" onChange={props.changeFavorite}>
        <option value={props.selected.name}>Favorite</option>
      </select>
      <input
        type="checkbox"
        checked={props.checked}
        onClick={props.changeFavorite}
      />
    </div>
  )
}
